import { Box, Button,  Grid, InputLabel, MenuItem, Select, TextField, Typography } from '@mui/material'
import { styled } from "@mui/material/styles";
import React from 'react'




// Custom TextField

const CTextField = styled(TextField)({
  '& .MuiInputBase-input': {

    position: 'relative',
    fontSize: 20,
    padding: '12px',

  },
  "& label.Mui-focused": {
    color: "#9B3C21"
  },

  "& .MuiOutlinedInput-root": {
    "& fieldset": {
      border: "2px solid #000000",
    },
    "&.Mui-focused fieldset": {

      border: "2px solid #9B3C21"
    }
  }
});


const Add_item = () => {

  const [age, setAge] = React.useState('');

  const handleChange = (event) => {
    setAge(event.target.value);
  };


  return (
    <div>


      {/* WHOLE CONTAINER LOADS */}
      <Grid container spacing={2} style={{
        border:'2px solid red'
      }}>


        {/* Add Item */}
        <Grid containe marginTop={10} marginLeft={10}>
          <Typography variant='h3'> Add new item</Typography>
        </Grid>

        {/* container inputs */}
        <Grid
        fixed
          container
          direction="row"
          justifyContent="center"
          alignItems="center">

{/* isa pang container para maayos ang margin */}
          <Grid
          container
          fixed
          marginY={2}
          marginLeft={5}
          marginRight={2}
          direction="row"
          justifyContent="center"
          alignItems="center"
    
          >
      
            <Grid container
            margin={2}
                 direction="row"
                 justifyContent="center"
                 alignItems="center"
                 style={{
                  width:800,
                  border: '2px solid black',
                  borderRadius: '8px',
                  backgroundColor: 'white'
                 }}
                 >

          {/* Label Productname */}
              <Grid container  item md={5} justifyContent="center" margin={2}>
                 <Typography  variant='h5'>Product name</Typography>
              </Grid>

          {/* Input Productname*/}
              <Grid item md={6} marginX={1}>
                <CTextField fullWidth type='text' placeholder='Product name' variant="outlined" margin="normal"/>
              </Grid>


{/* ////////////////////////////////////////////////////////// */}

  {/* Label Productname */}
              <Grid container item md={5} justifyContent="center" margin={2}>
                 <Typography  variant='h5'>Product Category</Typography>
              </Grid>

{/* Label Category */}
              <Grid item md={6} marginX={1}>
                    <InputLabel id="demo-simple-select-label">Product Category</InputLabel>
                    
                    <Select
                    labelId="demo-simple-select-label"
                    id="demo-simple-select"
                    displayEmpty
                    fullWidth
                    value={age}
                    label="Age"
                    onChange={handleChange}>
                      <MenuItem disable value={''}>ADD NEW CATEGORY</MenuItem>
                      <MenuItem value={'wala pa'}>wala pa</MenuItem>
                      <MenuItem value={'/wala pa'}>wala pa</MenuItem>
                      <MenuItem value={'wala pa'}>wala pa</MenuItem>

                    </Select>
              </Grid>

{/* ////////////////////////////////////////////////////////// */}

              <Grid container item md={5} justifyContent="center" margin={2}>
                 <Typography  variant='h5'>Product name</Typography>
              </Grid>
              <Grid item md={6} marginX={1}>
                <CTextField fullWidth  placeholder='Product name' variant="outlined" margin="normal"/>
              </Grid>
              <Grid container item md={5} justifyContent="center" margin={2}>
                 <Typography  variant='h5'>Product name</Typography>
              </Grid>
              <Grid item md={6} marginX={1}>
                <CTextField fullWidth  placeholder='Product name' variant="outlined" margin="normal"/>
              </Grid>
              
            </Grid>
            


          </Grid>

          <Button 
          variant='contained'  
          style={{
            borderRadius: '10px',
            width:200,
            marginBottom:10,
            padding:10
          }}> create </Button>

            <Button variant='contained'  style={{
            borderRadius: '10px',
            width:200,
            marginBottom:10,
            padding:10
          }}> cancel </Button>

        </Grid>

        













      </Grid>
      
    </div>
  )
}

export default Add_item
